import React from 'react';
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";

export default function Login() {
    return  (
        <div class="login-header">
            <h2>Login</h2>
            <form method="post">
                <label for="Username">Username:</label>
                <input id="login-box" name="username" placeholder="username" required>
                </input>
                <br />
                <input id="login-box" name="pwd" placeholder="password" required>
                </input>
                <br />
                <button type="submit">Login</button>
            </form>
        </div>
    );
}
